import React from "react";
import { Link } from 'react-router-dom';
import s from "./NavBar.module.css"


function NavBar() {
return(
<div className={s.navcontainer}>
    <div className={s.navbrand}>
        <Link to='' className={s.navbrandlink}><h2>Recipe Book</h2></Link>
    </div>
    <ul className={s.navlinks}>
        <li><Link to='/home' className={s.navlink}><h5>Home</h5></Link></li>
        <li><Link to='/recipes' className={s.navlink}><h5>Create your recipe</h5></Link></li>
    </ul>
</div>
)
}





export default NavBar
